import React from "react";
import "./Product_list2.css";

const Store = [{
  Store_name: "abc_store",
  division: "chittagong",
  district: "chittagong",
  thana: "chittagong",
  url: "./img/store-1.jpg"
},
{
  Store_name: "bcd_store",
  division: "chittagong",
  district: "chittagong",
  thana: "chittagong",
  url: "./img/store-1.jpg"
},
{
  Store_name: "efg_store",
  division: "chittagong",
  district: "chittagong",
  thana: "chittagong",
  url: "./img/store-1.jpg"
}
]


function Product_list2({ product, addToCart }) {
  return (
    <div className="flex product_list2">
      {Store.map((item, productIndex) => {
        return (
          <div className="product-item-container" key={productIndex}>
            <div className="product-item">
              <img src={item.url} alt={item.name} />
              <p className="product-name">{item.name} | {item.category}</p>
              <button> Details </button>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Product_list2;
